      SELECT ALL col1 - + - 33 + + col0 * + col2 + + - col0 / - col1 / 38 AS col2 FROM tab1 (FORMAT parquet) AS cor0 WHERE NULL <= col2 * col0 * - col1;
  - name: tab1

outputs:
  - name: q199.out
    data: |
